import{_ as a,o as e,c as o,a2 as i}from"./chunks/framework.C766EroN.js";const m=JSON.parse('{"title":"Populating Data 数据填充","description":"NetBox 数据填充方法","frontmatter":{"title":"Populating Data 数据填充","description":"NetBox 数据填充方法"},"headers":[],"relativePath":"tech-share/netbox/4.5.1/community/getting-started/populating-data.md","filePath":"tech-share/netbox/4.5.1/community/getting-started/populating-data.md"}'),r={name:"tech-share/netbox/4.5.1/community/getting-started/populating-data.md"};function n(s,t,p,c,l,d){return e(),o("div",null,[...t[0]||(t[0]=[i('<h1 id="populating-data-数据填充" tabindex="-1">Populating Data / 数据填充 <a class="header-anchor" href="#populating-data-数据填充" aria-label="Permalink to &quot;Populating Data / 数据填充&quot;">​</a></h1><p><em>内容来源 / Source: <a href="https://netboxlabs.com/docs/netbox/getting-started/populating-data/" target="_blank" rel="noreferrer">NetBox Labs Documentation</a> | 如有侵权请<a href="/contact.html">联系我们</a>删除</em></p><p>This section covers the mechanisms which are available to populate data in NetBox.</p><p>本节介绍 NetBox 中可用的数据填充方法。</p><h2 id="manual-object-creation-手动创建对象" tabindex="-1">Manual Object Creation / 手动创建对象 <a class="header-anchor" href="#manual-object-creation-手动创建对象" aria-label="Permalink to &quot;Manual Object Creation / 手动创建对象&quot;">​</a></h2><p>The simplest way is to use the object creation forms in the user interface. Find the object type in the navigation menu and click the green &quot;Add&quot; button.</p><p>最简单的方式是使用用户界面中的对象创建表单。在导航菜单中找到对象类型，点击绿色的 &quot;Add&quot; 按钮。</p><div class="warning custom-block"><p class="custom-block-title">不适合大批量导入</p><p>Creating objects one at a time does not scale well. For large imports, use CSV/YAML import, scripting, or the REST API.</p></div><h2 id="bulk-import-csv-yaml-批量导入" tabindex="-1">Bulk Import (CSV/YAML) / 批量导入 <a class="header-anchor" href="#bulk-import-csv-yaml-批量导入" aria-label="Permalink to &quot;Bulk Import (CSV/YAML) / 批量导入&quot;">​</a></h2><p>NetBox supports bulk import using CSV-formatted data. CSV can be imported as raw text or by uploading a file. If an &quot;id&quot; field is added, data will update existing records instead of creating new ones.</p><p>NetBox 支持使用 CSV 格式进行批量导入。某些模型（如 device types、module types）使用 YAML 格式以支持父子对象导入。</p><h2 id="scripting-脚本" tabindex="-1">Scripting / 脚本 <a class="header-anchor" href="#scripting-脚本" aria-label="Permalink to &quot;Scripting / 脚本&quot;">​</a></h2><p>For patterned data (e.g., 100 sites × 5 VLANs each), custom scripts can automatically create objects according to a pattern. This ensures validity and eliminates manual verification.</p><p>对于有规律的数据，可使用自定义脚本按模式自动创建对象。</p><h2 id="rest-api-rest-api" tabindex="-1">REST API / REST API <a class="header-anchor" href="#rest-api-rest-api" aria-label="Permalink to &quot;REST API / REST API&quot;">​</a></h2><p>Full programmatic control over object creation. Supports bulk creation in a single request. See <a href="./../features/api-integration.html">REST API documentation</a>.</p><p>可通过 REST API 以编程方式创建对象，支持单次请求批量创建。</p>',17)])])}const h=a(r,[["render",n]]);export{m as __pageData,h as default};
